window.bookSummaryJSON = "Today's hottest urban fantasy authors come together in this delicious brew that crackles and boils over with tales of powerful witches and dark magic! <p>In Charlaine Harris' \"Bacon\", a beautiful vampire joins forces with a witch from an ancient line to find out who killed her beloved husband.</p> <p>In \"Seeing Eye\", by Patricia Briggs, a blind witch helps sexy werewolf Tom Franklin find his missing brother - and helps him in more ways than either of them ever suspected.</p> <p> And in Jim Butcher's \"Last Call\", wizard Harry Dresden takes on the darkest of dark powers - the ones who dare to mess with his favorite beer.</p> <p>For anyone who's ever wondered what lies beyond the limits of reality, who's imagined the secret spaces where witches wield fearsome magic, come and drink deep. Let yourself fall under the spell of this bewitching collection!</p>"; 
